      SELECT + 79 FROM tab2 (FORMAT parquet) WHERE - 81 IN ( col0 * col0, col2 + - 75, - col1, + col2, 49 * 87 * - col0 / + col0 * - col0, - + col2 );
  - name: tab2

outputs:
  - name: q10256.out
    data: |
